var Reset=function(window){this.window = window;};Reset.prototype.resetByClass = function(cls,cls2){$(window).resize(function () {var e = document.getElementsByClassName(cls);var e2 = document.getElementsByClassName(cls2);for(i=0;i<e.length;i++){if (e[i] != null){e[i].parentNode.removeChild( e[i]);}}for(i=0;i<e2.length;i++){if (e2[i] != null){e2[i].parentNode.removeChild( e2[i]);}}});};
